listing_description:
2 Bedroom 1 Bathroom

$330 per week

AVAILABLE NOW

This neat and tidy 2 bedroom, 1 bathroom cottage style home is sure to please. Come and live in the country and escape the daily grind. Located next to agriculture paddocks you will enjoy the sight and sounds of cows as well as the sound of the tranquil running Collie River.

Property Features Include:
Two well sized bedrooms one with wardrobe storage both have ceiling fans; 
The bathroom is good sized with free standing shower and vanity storage; 
The kitchen offers ample cupboard space, gas cooktop and opens to lounge room;
Lounge room offers wood fire and ceiling fan;
Reverse cycle aircon in the kitchen/ lounge area;
Outdoor deck nestled amongst nature perfect to sit out and enjoy the serenity; 
There is an open style shed which could be used as storage if so desired;
As this cottage is open and located near paddocks it would not suit dogs however it is open to other animals if they were suitable.

For more information or to arrange a viewing time call our 24 hour line on (08) 9779 9990.

 Application Forms can be found on our website http://umbrellarealty.com.au/ collected from the office or will be available at the viewing. To be prepared for the application process be sure to have 100 points of ID and proof of income. The property must be viewed prior to submitting an application.

Property Code: 822
